import {
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from "@mui/material";
import { useState, useEffect } from "react";
import { FaSpinner } from "react-icons/fa";
import { BiSkipNext } from "react-icons/bi";
import { MdModeEdit } from "react-icons/md";
import { IoTrashOutline } from "react-icons/io5";
import { useParams, useNavigate } from "react-router-dom";
import CompanyNavigation from "../../../../Common/CompanyNavigation";
import LoanIconButton from "../../../../Common/LoanIconButton";
import { ToastContainer, toast } from "react-toastify";
import CompanyModal from "../../../Common/CompanyModal";
import { Link } from "react-router-dom";
import CommonServices from "../../../Common/CommonServices";
// import AddCreditFacilityUtilizition from "./AddCreditPerformance";
import overDraftFacilityService from "./OverDraftFacilityService";
import AddPreshipmentFacility from "./AddOverDraftFacility";
import LoanTextField from "../../../../Common/LoanTextField";
import AddOverDraftFacility from "./AddOverDraftFacility";
const ViewOverDraftFacility = ({
  isOverDraftFacilityModalOpen,
  handleOverDraftFacilityOpenModal,
  handleOverDraftFacilityCloseModal,
  overDraftFacility,
  creditFacilityUtilizitionId,
}) => {
  const [overDraftFacilityErrorLoading, setOverDraftFacilityErrorLoading] =
    useState(false);
  const navigate = useNavigate();
  const [preshipmentFacilityId, setPreshipmentFacilityId] = useState([]);
  const [deleteLoading, setDeleteLoading] = useState(false);
  const [startDate, setStartDate] = useState(new Date());
  const [expiredDate, setExpiredDate] = useState(new Date());
  const [maturityDate, setMaturityDate] = useState(new Date());
  const [deleteOverDraftFacilityError, setOverDraftFacilityDeleteError] =
    useState(null);
  const [error, setError] = useState(null);
  const [
    isOverDraftFacilityEditModalOpen,
    setIsOverDraftFacilityEditModalOpen,
  ] = useState(false);
  function handleOverDraftFacilityEditOpenModal() {
    setIsOverDraftFacilityEditModalOpen(true);
  }
  function handleOverDraftFacilityEditCloseModal() {
    setIsOverDraftFacilityEditModalOpen(false);
  }
  function handleOverDraftFacilityEditOpenModal() {
    setIsOverDraftFacilityEditModalOpen(true);
  }
  function handleOverDraftFacilityEditCloseModal() {
    setIsOverDraftFacilityEditModalOpen(false);
  }  
  const [overDraftFacilityId, setOverDraftFacilityId] =
    useState(null);
  const handleInputChangeOverDraftFacility = (event) => {
    const { name, value } = event.target;
    setOverDraftFacilitys({
      ...overDraftFacilitys,
      [name]: value,
    });
  };
  const initialOverDraftFacilityState = {
    Id: null,
    ApprovedFacilityLimit: "",
    StartDate: "",
    ExpiredDate: "",
    Year: "",
    Month: "",
    HighestDebitBalance: "",
    HighestCreditBalance: "",
    LowestDebitBalance: "",
    LowestCreditBalance: "",
    NoOfDaysInCreditBalanceInMonth: "",
    TotalDebitTransactionBalanceInMonth: "",
    TotalCreditTransactionBalanceInMonth: "",
    TurnoverPerPeriod: "",
    NoOfDaysInCreditBalanceInPeriod: "",
  };
  const [overDraftFacilitys, setOverDraftFacilitys] = useState(
    initialOverDraftFacilityState
  );
  const newOverDraftFacility = () => {
    setOverDraftFacilitys(initialOverDraftFacilityState);
    // setSubmitted(false);
  };
  const saveOverDraftFacility = () => {
    var data = {
      ApprovedFacilityLimit: overDraftFacilitys.ApprovedFacilityLimit,
      StartDate: overDraftFacilitys.StartDate,
      ExpiredDate: overDraftFacilitys.ExpiredDate,
      Year: overDraftFacilitys.Year,
      Month: overDraftFacilitys.Month,
      HighestDebitBalance: overDraftFacilitys.HighestDebitBalance,
      HighestCreditBalance: overDraftFacilitys.HighestCreditBalance,
      LowestDebitBalance: overDraftFacilitys.LowestDebitBalance,
      LowestCreditBalance: overDraftFacilitys.LowestCreditBalance,
      NoOfDaysInCreditBalanceInMonth:
        overDraftFacilitys.NoOfDaysInCreditBalanceInMonth,
      TotalDebitTransactionBalanceInMonth:
        overDraftFacilitys.TotalDebitTransactionBalanceInMonth,
      TotalCreditTransactionBalanceInMonth:
        overDraftFacilitys.TotalCreditTransactionBalanceInMonth,
      TurnoverPerPeriod: overDraftFacilitys.TurnoverPerPeriod,
      NoOfDaysInCreditBalanceInPeriod:
        overDraftFacilitys.NoOfDaysInCreditBalanceInPeriod,
    };
    overDraftFacilityService
      .addPreshipmentFacility(data, creditFacilityUtilizitionId)
      .then((response) => {
        setOverDraftFacilitys({
          Id: response.data.Id,
          ApprovedFacilityLimit: response.data.ApprovedFacilityLimit,
          StartDate: response.data.StartDate,
          ExpiredDate: response.data.ExpiredDate,
          Year: response.data.Year,
          Month: response.data.Month,
          HighestDebitBalance: response.data.HighestDebitBalance,
          HighestCreditBalance: response.data.HighestCreditBalance,
          LowestDebitBalance: response.data.LowestDebitBalance,
          LowestCreditBalance: response.data.LowestCreditBalance,
          NoOfDaysInCreditBalanceInMonth:
            response.data.NoOfDaysInCreditBalanceInMonth,
          TotalDebitTransactionBalanceInMonth:
            response.data.TotalDebitTransactionBalanceInMonth,
          TotalCreditTransactionBalanceInMonth:
            response.data.TotalCreditTransactionBalanceInMonth,
          TurnoverPerPeriod: response.data.TurnoverPerPeriod,
          NoOfDaysInCreditBalanceInPeriod:
            response.data.NoOfDaysInCreditBalanceInPeriod,
        });
        if (response.data.Code === 200) {
          setOverDraftFacilitys(initialOverDraftFacilityState);
          console.log(response.data);
          // setHoldId(response.data.Result.Id);
          overDraftFacility();
          toast.success("Added successfully", {
            position: toast.POSITION.TOP_RIGHT,
            toastId: "PreshipmentFacility",
          });
        }
      })
      .catch((e) => {
        console.log(e);
      });
  };
  const handleDelete = (overDraftFacility) => {
    setDeleteLoading(true);
    const confirm = window.confirm(
      `Are you sure you want to delete ${overDraftFacility.Id}?`
    );
    if (confirm) {
      toast.success("Deleting", {
        position: toast.POSITION.TOP_RIGHT,
        toastId: "deletePreshipmentFacility",
      });
      overDraftFacilityService
        .deletepreshipmentFacilityById(overDraftFacility.Id)
        .then(() => {
          overDraftFacility((previousData) =>
            previousData.filter((comp) => comp.Id !== overDraftFacility.Id)
          );
        })
        .catch((e) => {
          setOverDraftFacilityDeleteError(e);
          setDeleteLoading(false);
        });
    }
  };
  const [editOverDraftFacility, setEditOverDraftFacility] = useState({
    //  Id: editAddresAccountDetailId,
    ApprovedFacilityLimit: "",
    StartDate: "",
    ExpiredDate: "",
    Year: "",
    Month: "",
    HighestDebitBalance: "",
    HighestCreditBalance: "",
    LowestDebitBalance: "",
    LowestCreditBalance: "",
    NoOfDaysInCreditBalanceInMonth: "",
    TotalDebitTransactionBalanceInMonth: "",
    TotalCreditTransactionBalanceInMonth: "",
    TurnoverPerPeriod: "",
    NoOfDaysInCreditBalanceInPeriod: "",
  });

  const handleInputChangeEditOverDraftFacility = (event) => {
    const { name, value } = event.target;
    setEditOverDraftFacility({
      ...editOverDraftFacility,
      [name]: value,
    });
  };

  const getOverDraftFacilityId = (editOverDraftFacilityId) => {
    overDraftFacilityService
      .getpreshipmentFacilityById(editOverDraftFacilityId) //here is
      .then((res) => {
        setEditOverDraftFacility({
          ...editOverDraftFacility,
          Id: editOverDraftFacilityId,
          ApprovedFacilityLimit: res.data.Result.ApprovedFacilityLimit,
          StartDate: res.data.Result.StartDate,
          ExpiredDate: res.data.Result.ExpiredDate,
          Year: res.data.Result.Year,
          Month: res.data.Result.Month,
          HighestDebitBalance: res.data.Result.HighestDebitBalance,
          HighestCreditBalance: res.data.Result.HighestCreditBalance,
          LowestDebitBalance: res.data.Result.LowestDebitBalance,
          LowestCreditBalance: res.data.Result.LowestCreditBalance,
          NoOfDaysInCreditBalanceInMonth:
            res.data.Result.NoOfDaysInCreditBalanceInMonth,
          TotalDebitTransactionBalanceInMonth:
            res.data.Result.TotalDebitTransactionBalanceInMonth,
          TotalCreditTransactionBalanceInMonth:
            res.data.Result.TotalCreditTransactionBalanceInMonth,
          TurnoverPerPeriod: res.data.Result.TurnoverPerPeriod,
          NoOfDaysInCreditBalanceInPeriod:
            res.data.Result.NoOfDaysInCreditBalanceInPeriod,
        });
      })
      .catch((err) => {
        if (err.response.data.StatusCode === 404) {
          console.log(err.response.data.Message);
        }
      });
  };
  const updateOverDraftFacilityById = (e) => {
    e.preventDefault();
    overDraftFacilityService
      .updateOverDraftFacilityById(overDraftFacilityId, editOverDraftFacility)
      .then((response) => {
        if (response.data.Code === 200) {
          overDraftFacility();
          toast.success("Updated successfully", {
            position: toast.POSITION.TOP_RIGHT,
            toastId: "updateCompany",
          });
        }
      })
      .catch((e) => {
        console.log(e);
      });
  };
  return (
    <div>
      <CompanyModal
        isOpen={isOverDraftFacilityModalOpen}
        onClose={handleOverDraftFacilityCloseModal}
        title=" preshipment information"
      >
        <div className="px-4 py-3 ">
          <div className="w-flex flex-col bg-gray-800w-96 py-8 px-4 text-center">
            <div className="rounded-lg overflow-hidden overflow-x-scroll overflow-y-scroll">
              {/* <div className="bg-gray-100 flex items-center justify-center h-screen"> */}
              <div>
                <h4 className="text-lg font-semibold eading-tight p-2"></h4>
                <AddOverDraftFacility
                  handleInputChangeOverDraftFacility={
                    handleInputChangeOverDraftFacility
                  }
                  saveOverDraftFacility={saveOverDraftFacility}
                  preshipmentFacilitys={overDraftFacilitys}
                  setPreshipmentFacilitys={setOverDraftFacilitys}
                />
                <div>
                  {error && <p className="text-red-500">{error}</p>}
                  {!error && overDraftFacilityErrorLoading ? (
                    <span>
                      <FaSpinner
                        className="animate-spin rounded-full h-6 w-6 text-purple-600"
                        fontSize="small"
                        data-toggle="tooltip"
                        title="Click it to sign in"
                      />
                      Loading...
                    </span>
                  ) : (
                    !error &&
                    !overDraftFacilityErrorLoading && (
                      <div className="overflow-x-auto">
                        <table className="min-w-full table table-bordered table-striped bg-purple-100">
                          <thead>
                            <tr className="bg-purple-200">
                              <th className="px-2 py-4">
                                {" "}
                                ApprovedFacilityLimit
                              </th>
                              <th className="px-2 py-4"> StartDate </th>
                              <th className="px-2 py-4"> ExpiredDate</th>
                              <th className="px-2 py-4"> Year </th>
                              <th className="px-2 py-4"> Month </th>
                              <th className="px-2 py-4">
                                {" "}
                                HighestDebitBalance{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                HighestCreditBalance{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                LowestDebitBalance{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                LowestCreditBalance{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                NoOfDaysInCreditBalanceInMonth{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                TotalDebitTransactionBalanceInMonth{" "}
                              </th>
                              <th className="px-2 py-4">
                                {" "}
                                TotalCreditTransactionBalanceInMonth{" "}
                              </th>
                              <th className="px-2 py-4"> TurnoverPerPeriod </th>
                              <th className="px-2 py-4">
                                NoOfDaysInCreditBalanceInPeriod{" "}
                              </th>
                              <th className="px-2 py-4"> Action </th>
                            </tr>
                          </thead>
                          <tbody>
                            {overDraftFacility.length === 0 ? (
                              <p className="text-red-600 p-4">Data not found</p>
                            ) : (
                              overDraftFacility.map(
                                (preshipmentFacilitys, index) => (
                                  <tr
                                    key={index}
                                    className="bg-white
                    border-b border-purple-200"
                                  >
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.ApprovedFacilityLimit
                                      }
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.StartDate}
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.ExpiredDate}
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.Year}
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.Month}
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.HighestDebitBalance}
                                    </td>
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.HighestCreditBalance
                                      }
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.LowestDebitBalance}
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.LowestCreditBalance}
                                    </td>
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.NoOfDaysInCreditBalanceInMonth
                                      }
                                    </td>
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.TotalDebitTransactionBalanceInMonth
                                      }
                                    </td>
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.TotalCreditTransactionBalanceInMonth
                                      }
                                    </td>
                                    <td className="p-2">
                                      {preshipmentFacilitys.TurnoverPerPeriod}
                                    </td>
                                    <td className="p-2">
                                      {
                                        preshipmentFacilitys.NoOfDaysInCreditBalanceInPeriod
                                      }
                                    </td>
                                    <td>
                                      <button
                                        delete
                                        type="submit"
                                        onClick={() => {
                                          handleDelete(preshipmentFacilitys);
                                        }}
                                        className="text-red-600 rounded-md font-semibold "
                                      >
                                        delete
                                      </button>
                                    </td>
                                    <td>
                                      <button
                                        edit
                                        type="submit"
                                        onClick={() => {
                                          handleOverDraftFacilityEditOpenModal();
                                          getOverDraftFacilityId(
                                            preshipmentFacilitys.Id
                                          );
                                          setOverDraftFacilityId(
                                            preshipmentFacilitys.Id
                                          );
                                        }}
                                        className="text-red-600 rounded-md font-semibold "
                                      >
                                        Edit
                                      </button>
                                    </td>
                                  </tr>
                                )
                              )
                            )}
                          </tbody>
                        </table>
                      </div>
                    )
                  )}
                </div>
              </div>
            </div>
          </div>
        </div>
      </CompanyModal>
      <CompanyModal
        isOpen={isOverDraftFacilityEditModalOpen}
        onClose={handleOverDraftFacilityEditCloseModal}
        title="Modify account detail information"
      >
        <div>
          <form onSubmit={updateOverDraftFacilityById}>
            <div className="grid grid-cols-1 gap-4 submit-form">
              <div className="submit-form ">
                <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                  <LoanTextField
                    id="ApprovedFacilityLimit"
                    label="ApprovedFacilityLimit"
                    value={editOverDraftFacility.ApprovedFacilityLimit}
                    onChange={handleInputChangeOverDraftFacility}
                    name="ApprovedFacilityLimit"
                  />
                  <p>
                    Start Date:
                    <input
                      id="StartDate"
                      name="StartDate"
                      label="StartDate"
                      placeholder="StartDate"
                      type="date"
                      value={
                        startDate.getFullYear().toString() +
                        "-" +
                        (startDate.getMonth() + 1).toString().padStart(2, 0) +
                        "-" +
                        startDate.getDate().toString().padStart(2, 0)
                      }
                      onChange={(e) => {
                        setStartDate(new Date(e.target.value));
                        editOverDraftFacility.StartDate = startDate;
                      }}
                    />{" "}
                  </p>
                  <p>
                    Expired Date:
                    <input
                      id="ExpiredDate"
                      name="ExpiredDate"
                      label="ExpiredDate"
                      placeholder="ExpiredDate"
                      type="date"
                      value={
                        maturityDate.getFullYear().toString() +
                        "-" +
                        (maturityDate.getMonth() + 1)
                          .toString()
                          .padStart(2, 0) +
                        "-" +
                        maturityDate.getDate().toString().padStart(2, 0)
                      }
                      onChange={(e) => {
